import { Document, Page } from 'react-pdf/dist/esm/entry.webpack';


interface MyComponentProps {
  file: string;
}

class MyComponent extends React.Component<MyComponentProps> {
  render() {
    return (
      <div>
        <Document file={this.props.file}>
          <Page pageNumber={1} width={500} />
        </Document>
      </div>
    );
  }
}
